  `outstanding` float(18,3) DEFAULT NULL COMMENT 'ប្រាក់ដើមនៅមុនបង់',
  `old_principal_permonth` float(18,2) DEFAULT NULL,
  `principal_amount` float(18,3) DEFAULT NULL COMMENT 'ប្រាក់ដើមនៅសល់បន្ទាប់ពីបង់',
  `total_principal_permonth` float(18,3) DEFAULT NULL COMMENT 'ប្រាក់ដើមត្រូវបង់',
  `total_principal_permonthpaid` float(18,3) DEFAULT NULL COMMENT 'ប្រាក់ដើមបានបង់',
  `total_interest_permonth` float(18,3) DEFAULT NULL COMMENT 'ប្រាក់ការត្រូវបង់',
  `total_interest_permonthpaid` float(18,3) DEFAULT NULL,
  `penalize_amount` float(18,3) DEFAULT NULL COMMENT 'ពិន័យត្រូវបង់',
  `penalize_amountpaid` float(18,3) DEFAULT NULL COMMENT 'ពិន័យបានបង់',
  `service_charge` float(18,3) DEFAULT NULL,
  `service_chargepaid` float(18,3) DEFAULT NULL,
  `balance` float(10,2) DEFAULT NULL,
  `total_payment` float(18,3) DEFAULT NULL COMMENT 'ត្រូវបង់',
  `amount_payment` float(18,3) DEFAULT NULL COMMENT 'ប្រាក់បានបង់សរុប',
  `recieve_amount` float(18,3) DEFAULT NULL COMMENT 'ប្រាក់បានទទួលសរុប',
