  `fixed_payment_before` float(10,2) DEFAULT NULL,
  `paid_before` float(10,2) DEFAULT NULL,
  `balane_before` float(10,2) DEFAULT NULL,
  `period_before` float(10,2) DEFAULT NULL COMMENT 'loan number after reschedule',
  `discount_after` float(10,2) DEFAULT NULL,
  `principal_after` float(10,2) DEFAULT NULL,
  `start_date_after` date DEFAULT NULL,
  `first_payment_after` date DEFAULT NULL,
