/*Table structure for table `ln_sale` */

DROP TABLE IF EXISTS `ln_sale`;

CREATE TABLE `ln_sale` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `branch_id` int(11) DEFAULT '1',
  `receipt_no` varchar(30) DEFAULT NULL,
  `house_id` int(11) DEFAULT NULL,
  `sale_number` varchar(30) DEFAULT NULL,
  `client_id` int(11) DEFAULT NULL,
  `price_before` float(10,2) DEFAULT NULL COMMENT 'តម្លៃលក់',
  `discount_amount` float(10,2) DEFAULT NULL,
  `price_sold` float(15,2) DEFAULT NULL,
  `admin_fee` float(10,2) DEFAULT NULL,
  `other_fee` float(10,2) DEFAULT NULL,
  `paid_amount` float(10,2) DEFAULT NULL,
  `balance` float(10,2) DEFAULT NULL COMMENT 'ប្រាក់ជំពាក់នៅសល់',
  `graice_period` float(10,2) DEFAULT '0.00' COMMENT 'អនុគ្រោះបង់ដំបូង',
  `amount_collect` float(10,2) DEFAULT '1.00' COMMENT 'រយះពេលប៉ុន្មានខែបង់១ដង',
  `buy_date` date DEFAULT NULL,
  `startcal_date` date DEFAULT NULL COMMENT 'ថ្ងៃចាប់ផ្តើមបង់ប្រាក់',
  `first_payment` date DEFAULT NULL,
  `end_line` date DEFAULT NULL COMMENT 'life of loan',
  `validate_date` date DEFAULT NULL COMMENT 'ថ្ងៃផុតប្រាក់កក់',
  `create_date` date DEFAULT NULL,
  `interest_rate` float(5,2) DEFAULT NULL,
  `total_duration` int(11) DEFAULT NULL COMMENT 'រយះពេលខ្ចី',
  `payment_method` int(11) DEFAULT '1',
  `payment_type` int(11) DEFAULT '1' COMMENT 'បង់ជាCash ,Bank Transfer,Cheuee',
  `payment_number` varchar(30) DEFAULT NULL,
  `payment_id` int(11) DEFAULT NULL COMMENT '1=Book,2=Completed,3=step,4=installment,payment with bank',
  `staff_id` int(11) DEFAULT NULL,
  `holiday` tinyint(4) DEFAULT NULL,
  `level` int(20) DEFAULT '1' COMMENT 'វគ្គទី ប៉ុន្មាននៃកម្ចី',
  `status` tinyint(4) DEFAULT '1' COMMENT '0 deactive ,1 active ,2 complated',
  `is_reschedule` tinyint(4) DEFAULT '0' COMMENT 'ពេលចេញ reschedule ថ្មី befor reschedul 1,2=after',
  `user_id` int(11) DEFAULT NULL,
  `is_cancel` tinyint(4) DEFAULT '0',
  `reschedule_opt` tinyint(4) DEFAULT '0' COMMENT 'សំរាប់ចេញreschedule ថ្មី1= new schedule , 2 overide old schedule',
  `is_verify` tinyint(4) DEFAULT '0',
  `is_completed` tinyint(4) DEFAULT '0',
  `comission` float(10,2) DEFAULT NULL,
  `note` text,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

