insert  into `ln_termcondiction`(`id`,`con_khmer`,`con_english`,`status`,`user_id`) values (1,'២.១ អ្នកលក់ជាម្ចាស់អចលនវត្ថុ ពេញច្បាប់តែមួយគត់ ពុំមានបុគ្គល ឬអង្គភាពណាមួយមានផលប្រយោជន៍លើកម្មសិទ្ធិនៃ អចលនវត្ថុឡើយ។\r\n ២.២ អ្នកលក់ធានាថា ការសាងសង់នឹងត្រូវបញ្ចប់ ក្នុងអំឡុងពេល18(ដប់ប្រាំបីខែ) គិតចាប់ពីថ្ងៃផ្តិតមេដៃលើកិច្ចព្រមព្រៀងនេះលើកលែងតែអ្នកទិញ មិនបានបង់ប្រាក់ តាមកាលកំណត់ ឫ ករណីប្រធានសក្តិដូចជា\r\n ទឹកជំនន់ រញ្ជួយដី វិបត្តិនយោបាយ អស្ថេរភាពសង្គមកើតឡើងដែលអាចបណ្តាល អោយមានការរាំងស្ទះដល់ការសាងសង់។\r\n ២.៣ អ្នកលក់នឹងធ្វើការតភ្ជាប់បណ្ដាញទឹក ភ្លើង(20A)ជូនអ្នកទិញ។\r\n ២.៤ អ្នកលក់ធានាការជួសជុលសំណង់រយៈពេល 6ខែ គិតចាប់ពីថ្ងៃដែលប្រគល់ផ្ទះជូនអ្នកទិញ។\r\n ២.៥ ក្រុមហ៊ុននឹងក្រាលការ៉ូខាងមុខផ្ទះសំរាប់ផ្ទះល្វែងចាប់ពីទ្វារដល់ចំណីផ្លូវ ប៉ុន្ដែភាគីអ្នកទិញ រឺម្ចាស់ផ្ទះមិនអាចសាងសង់ជារបង ឬសំយ៉ាបនៅលើទីធ្លានៃការ៉ូនោះឡើយ។ ករណីនេះនឹងត្រូវយកមកអនុវត្តផងដែរចំពោះអ្នកទិញបន្ត នឹង អ្នកទទួលសិទ្ធិបន្តពីភាគី\r\nអ្នកទិញជាបន្តបន្ទាប់រៀងរហូត។\r\n២.៦ ក្នុងករណីដែលអ្នកទិញ ចង់ធ្វើការបង់ប្រាក់ថ្លៃទិញដោយប្រើប្រាស់កម្ចីពីធនាគា អ្នកទិញ ត្រូវជជែកពិភាក្សានិងទទួលការ\r\nឯកភាពជាមុនពីអ្នកលក់អំពីបែបបទនិងលក្ខខណ្ឌនៃការបង់ប្រាក់នេះ។\r\n២.៧ ក្នុងការណីអ្នកលក់ អាចបញ្ចប់ការសាងសង់មុនកាលកំណត់ អ្នកលក់ត្រូវជូនដំណឹងទៅអ្នកទិញដើម្បីទទួលការឯកភាពជាមុនពីអ្នកទិញក្នុងការបង់ប្រាក់និងប្រគល់-ទទួលផ្ទះមុនកាលកំណត់។\r\n២.៨ អ្នកលក់មានភារកិច្ចបំបែកប្លង់ក្បាលដី និងប្រគល់ជូនអ្នកទិញដើម្បីរក្សាទុក។\r\n២.៩ ក្រោយពីបានបង់ប្រាក់ថ្លៃទិញទាំងអស់គ្រប់ចំនួនអ្នកទិញអាចស្នើសុំធ្វើប័ណ្ឌសម្គាល់ម្ចាស់អចលនវត្ថុបាន ដោយសោហ៊ុយរត់ការ និងបង់ពន្ធប្រថាប់ត្រាជាបន្ទុករបស់អ្នកទិញ។\r\n២.១០ នៅក្នុងរយៈពេលនៃការការបង់រំលស់ អ្នកទិញត្រូវទិញធានារ៉ាប់រង អគ្គីភ័យលើផ្ទះសម្បែង (មួយឆ្នាំម្តង) ដែលការចំណាយទាំងស្រុងជាបន្ទុករបស់អ្នកទិញ  (ដោយគិតចាប់ពីថ្ងៃទទួលផ្ទះ)។\r\n២.១១ ការបង់រំលស់គឺ មានរយៈយ៉ាងយូរ 20 ឆ្នាំដោយបូកអាយុអ្នកទិញមិនអោយលើស ៦៥ឆ្នាំឡើយ ប៉ុន្តែប្រសិនបើអ្នកទិញចង់ធ្វើការបង់រំលស់លើសពីនេះ អ្នកទិញត្រូវមានអ្នកទទួលសិទ្ធ ឫតំណាង ក្នុងការបង់រំលស់បន្ត។','2.1\r\n2.2\r\n2.3',1,34);

