/* Procedure structure for procedure `selectclient` */

/*!50003 DROP PROCEDURE IF EXISTS  `selectclient` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `selectclient`(in id int)
BEGIN
select * from `ln_client` where `client_id`=id;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `stGetAccountNamebyOther` */

/*!50003 DROP PROCEDURE IF EXISTS  `stGetAccountNamebyOther` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `stGetAccountNamebyOther`(IN account_id INT,IN branch_id INT,IN currency_id INT)
BEGIN
 SELECT * from ln_account_branch where  account_id = account_id AND branch_id=branch_id AND currency_type = currency_id LIMIT 1 ;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `stGetAllClientType` */

/*!50003 DROP PROCEDURE IF EXISTS  `stGetAllClientType` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `stGetAllClientType`(in group_type int)
BEGIN
SELECT `client_id` ,`client_number`,`name_en` 
		,(SELECT village_name FROM `ln_village` WHERE vill_id = village_id  LIMIT 1) AS village_name
		,(SELECT commune_name FROM `ln_commune` WHERE com_id = com_id  LIMIT 1) AS commune_name
		,(SELECT district_name FROM `ln_district` AS ds WHERE dis_id = ds.dis_id  LIMIT 1) AS district_name
		,(SELECT province_en_name FROM `ln_province` WHERE province_id= pro_id  LIMIT 1) AS province_en_name
				
	FROM `ln_client` WHERE STATUS=1 AND name_en!='' ;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `stGetAllCOName` */

