/* Procedure structure for procedure `stgetAllPaymentById` */

/*!50003 DROP PROCEDURE IF EXISTS  `stgetAllPaymentById` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `stgetAllPaymentById`(IN client_id INT)
